import Keycloak from 'keycloak-js';

// Keycloak configuration - replace with your actual Keycloak server details
const keycloakConfig = {
  url: 'http://localhost:8080/auth/', // Your Keycloak server URL
  realm: 'SME',           // Your Keycloak realm
  clientId: 'front-end',
  client_secret_key:"lJ1cMpIeGL24VCBERDSUnvhZdf9IycKU"      // Your client ID in Keycloak
};

// Initialize Keycloak instance
const keycloak = new Keycloak(keycloakConfig);

export default keycloak;
